import React from 'react';
import './Watch.css';
import {BsSearch, BsFillCaretDownFill} from 'react-icons/bs';
import {GiSaveArrow} from 'react-icons/gi';
import { FaYoutube } from "react-icons/fa";

function Watch(){

  const WatchSider = () =>{
    return(
      <div className="watch-sider-container">
        <h5>Watch</h5>
        <div className="watch-head">
          <div className="watch-search">
            <input type="text" placeholder="Tìm kiếm video"/>
            <BsSearch />
          </div>
          <div className="watch-option">
            <ul>
              <li>
                <SiAsciinema /><span>Tất cả video</span>
              </li>
              <li>
                <GiSaveArrow /><span>Video đã lưu</span>
              </li>
            </ul>
          </div>
        </div>
        <div className="watch-history">
          <h6>Danh sách xem của bạn</h6>
          <ul>
            <li>
              <span>Sone things</span>
            </li>
            <li>
              <span>Sone things</span>
            </li>
          </ul>
          <div className="see-more">
            <BsFillCaretDownFill />
            <span>Xem thêm</span>
          </div>
        </div>
      </div>
    )
  }

  const WatchVideo = () =>{
    return(
      <div className="watch-video-container">
      </div>
    )
  }

  return(
    <div className="container">
      <div className="watch-container">
        <WatchSider />
        <WatchVideo />
      </div>
    </div>
  )
}

export default Watch;
